var tipuesearch = {"pages": [{'title': '首頁', 'text': '小組成員: \n 40823204 repo / 40823204 site \n 40823205 repo / 40823205 site \n 40823220 repo / 40823220 site \n 40823221 repo / 40823221 site \n 40823228 repo / 40823228 site \n 40823237 repo / 40823237 site \n 40823242 repo / 40823242 site \n 40823250 repo / 40823250 site \n 40832244 repo / 40832244 site \n', 'tags': '', 'url': '首頁.html'}, {'title': '每周進度', 'text': '', 'tags': '', 'url': '每周進度.html'}, {'title': 'W10 新增Stage1、2 工作分配', 'text': '資料整理 \n \n', 'tags': '', 'url': 'W10 新增Stage1、2 工作分配.html'}, {'title': 'stage1', 'text': 'bg14 \n 專題主題: 升降平台 \n 組員/分工: \n 40823228/成品零件繪製、模擬、報告影片 \n 40823242/初稿零件繪製、模擬、報告影片 \n \n 主題簡述: \n 在工地裡，經常需要在高處實施作業，可是 目前在外面看到的作業平台都是用組裝式 的，不僅延長工作時間，在搭建過程，也有 極大的掉落風險，所以我們小組設計出”油 壓式升降平台”，不僅方便攜帶，也大幅減 少風險與搭建平台的作業時間。 \n --------------------------------------- \n bg24 \n 專題主題:升降裝置 \n 組員/分工: \n 40823204/CoppeliaSim 測試、分組網站、PDF 製 作、reveal 簡報 \n 40823220/繪圖(Inventor)、reveal 簡報  \n \n 主題簡述: \n 方便搬運重物：大型可用來載人、小型可用在各 種自動化機械。 \n --------------------------------------- \n bg16 \n 專題主題:氣動馬達 \n 組員/分工: \n 40823221/ Coppelia模擬、PDF製作、合併倉儲及網站 \n 40823237/ 繪製圖檔、reveal製作、倉儲推送及維護 \n \n 主題簡述: \n 因為對汽車作動原理有些許興趣，所以以引擎 的活塞與皮帶輪關係做變化。 \n --------------------------------------- \n bg17 \n 專題主題:挖土機 \n 組員/分工: \n 40832244/ Coppelia模擬、PDF製作、合併倉儲及網站 \n 40823250/ 繪製圖檔、reveal製作、倉儲推送及維護 \n \n 主題簡述: \n 對於重物的搬運相當耗時，幫助在有需要的工作上。 \n --------------------------------------- \n bg11 \n 專題主題:鋼板滑車 \n 組員/分工: \n 40823205/零件繪製及組裝、PDF製作 \n 40823239/倉儲推送及維護、reveal簡報 \n \n 主題簡述: \n 工業上需要提起重物的地方很多，這種時候使用鋼板滑車，能夠更加省力的舉起重物。 \n --------------------------------------- \n', 'tags': '', 'url': 'stage1.html'}, {'title': 'stage2', 'text': 'bg12 \n 專題主題: 自動門 開門機構 \n 組員/分工: \n 40823221/ 網頁編輯、程式模擬、PDF簡報製作 \n 40823237/ 繪製圖檔、程式模擬、Reveal製作 \n 40823250/ 繪製圖檔、網頁編輯 \n 40832244/ 網頁編輯 \n 主題簡述: \n 剛開始會想做項專題的原因是因為在去 年發生了全世界的病毒感染，所以我們 想過類似門或是其他需要人體接觸的地 方盡量能讓人不用用手碰觸。 後來會做此設計也有對接觸做設計，所 以我們將感應器裝在門的周圍，是他可 以自動開啟。 \n --------------------------------------- \n bg14 \n 專題主題: 省力搬運機 \n 組員/分工: \n 40823204/SolidWorks 零件繪製、模擬、報告影片 \n 40823205/Inventor 零件繪製、模擬、報告影片 \n 40823220/ Inventor 零件繪製、模擬、報告影片 \n 40832228/ PDF 製作、模擬、報告影片 \n 40823242/應力分析、模擬、報告影片 \n 主題簡述: \n 在工地裡,經常需要用到台車搬運東西,例如裝著水泥的箱子,如果是要靠人力搬運的話,不僅會造成工作效率的減少,也會使搬運人員的體力大量消耗,所以討論過後,我們小組決定設計”省力搬運機”,不僅解決搬運問題,也大幅地提高工作效率與人員體力的損耗。 \n', 'tags': '', 'url': 'stage2.html'}, {'title': 'W11 討論小組主題', 'text': '4月29討論結果 主題:暫定 飛機或是汽車等之後再更改 \n \n', 'tags': '', 'url': 'W11 討論小組主題.html'}, {'title': 'W12 無障礙越野車繪製', 'text': '1. stage3主題:無障礙越野車 \n 2.動機:想要一台可以克服各種障礙地形的車子 \n 3.繪圖者:40823220 \n 4.機構:利用萬向接頭帶動蝸桿蝸輪 \n 5.想法:前後輪用雙向馬達驅動，萬象接頭用單向馬達，材料採中空鋁件設計使整體更輕，上面設置供電器 \n \n \n \n \n \n', 'tags': '', 'url': 'W12 無障礙越野車繪製.html'}, {'title': 'W13 無障礙越野車修改', 'text': '40823220網站 \n 本週主要為零件、產品大改良 \n 零件檔載點: 零件檔 \n 更進如下: \n 1.輪胎加大，紋路朝前，為了讓摩擦力增加 \n \n 2.將單向馬達架高，直接驅動蝸桿蝸輪，省略多餘的萬象接頭，使模擬更容易 \n \n 3.輪軸加大，使模擬安插軸更容易 \n 4.更改底板，因應前面所有改動，底板必須符合邏輯的變化 \n \n 修改完成使零件數目減少後，使攀爬機在CoppeliaSim中可以順利完成地形攀爬模擬。 \n ------------------------------------------------------------------------------------------------ \n 零件圖 \n 1.組合底板 \n \n 2.組合副底板 \n \n 3.蝸桿 \n \n 4.蝸輪 \n \n 5.輪胎 \n \n \n', 'tags': '', 'url': 'W13 無障礙越野車修改.html'}, {'title': 'W12-13coppelia模擬', 'text': '小組作品進度 \n 使用coppeliasim做初步模擬+lua控制 \n 說明:在場景中做初步的零件連接，並利用lua控制車子前進，但因為連接軸的問題，車子目前只能做前後移動和上下調整角度 \n \n', 'tags': '', 'url': 'W12-13coppelia模擬.html'}, {'title': 'W14coppelia模擬', 'text': '作品進度:將車子的連接方式改變，使其能夠轉彎 \n 因為原本車子輪胎是前後輪為一體的，為了不再修改圖面，使用coppeliasim內建功能toggle shape edit mode,把四個輪胎分開後並分別接上各個連接軸 \n 原先車子前後輪連接形式 \n \n 修改後之圖片 \n \n \n', 'tags': '', 'url': 'W14coppelia模擬.html'}, {'title': 'W15coppelia模擬', 'text': '場景ttt檔和py檔可至: 40823204 下載 \n 作品進度:將程式用lua改為python remote api 控制 \n \n 按鍵指令 \n "1-4"控制輪子轉彎方向 \n "w" 蝸桿蝸輪控制車體向上 \n "d" 蝸桿蝸輪控制車體向下 \n "a"車子向前 \n "d"車子向前後 \n import sim as vrep\nimport sim as vrep\nimport math\nimport random\nimport time\nimport keyboard\n \nprint (\'Start\')\n \n# Close eventual old connections\nvrep.simxFinish(-1)\n# Connect to V-REP remote server\nclientID = vrep.simxStart(\'192.168.50.217\', 19997, True, True, 5000, 5)\n  \nif clientID !=-1:\n    print (\'Connected to remote API server\')\n   \n    res = vrep.simxAddStatusbarMessage(\n        clientID, "40823204",\n        vrep.simx_opmode_oneshot)\n          \n    if res not in (vrep.simx_return_ok, vrep.simx_return_novalue_flag):\n        print("Could not add a message to the status bar.")\n          \n    opmode = vrep.simx_opmode_oneshot_wait\n    STREAMING = vrep.simx_opmode_streaming\n     \n    vrep.simxStartSimulation(clientID, opmode)\n    \n    \n    ret,joint=vrep.simxGetObjectHandle(clientID,"joint",opmode)\n    ret,joint2=vrep.simxGetObjectHandle(clientID,"joint2",opmode)\n    ret,joint5=vrep.simxGetObjectHandle(clientID,"joint5",opmode)\n    ret,joint3=vrep.simxGetObjectHandle(clientID,"joint3",opmode)\n    ret,joint4=vrep.simxGetObjectHandle(clientID,"joint4",opmode)\n    ds=0\n    dff=0\n    df=0\n    db=0\n    dbb=0\n    vrep.simxSetJointTargetPosition(clientID,joint,ds,opmode)\n    vrep.simxSetJointTargetPosition(clientID,joint2,dff,opmode)\n    vrep.simxSetJointTargetPosition(clientID,joint5,df,opmode)\n    vrep.simxSetJointTargetPosition(clientID,joint3,db,opmode)\n    vrep.simxSetJointTargetPosition(clientID,joint4,dbb,opmode)\n    \n    while True:\n        #Clockwise\n        if keyboard.is_pressed("w"):\n            ds=ds-0.01\n            vrep.simxSetJointTargetPosition(clientID,joint,ds,opmode)\n            print("up")\n        if keyboard.is_pressed("s"):\n            ds=ds+0.01\n            vrep.simxSetJointTargetPosition(clientID,joint,ds,opmode)\n            print("down")\n        if keyboard.is_pressed("a"):\n            df=df+0.2\n            db=db+0.2\n            dff=dff+0.2\n            dbb=dbb+0.2\n            vrep.simxSetJointTargetPosition(clientID,joint2,dff,opmode)\n            vrep.simxSetJointTargetPosition(clientID,joint5,df,opmode)\n            vrep.simxSetJointTargetPosition(clientID,joint3,db,opmode)\n            vrep.simxSetJointTargetPosition(clientID,joint4,dbb,opmode)\n            print("left")\n        if keyboard.is_pressed("d"):\n            df=df-0.2\n            db=db-0.2\n            dff=dff-0.2\n            dbb=dbb-0.2\n            vrep.simxSetJointTargetPosition(clientID,joint2,dff,opmode)\n            vrep.simxSetJointTargetPosition(clientID,joint5,df,opmode)\n            vrep.simxSetJointTargetPosition(clientID,joint3,db,opmode)\n            vrep.simxSetJointTargetPosition(clientID,joint4,dbb,opmode)\n            print("right")\n        if keyboard.is_pressed("1"):\n            df=df-0.2\n            db=db-0.2\n            vrep.simxSetJointTargetPosition(clientID,joint5,df,opmode)\n            vrep.simxSetJointTargetPosition(clientID,joint3,db,opmode)\n            print("1") \n        if keyboard.is_pressed("2"):\n            dff=dff-0.2\n            dbb=dbb-0.2\n            vrep.simxSetJointTargetPosition(clientID,joint2,dff,opmode)\n            vrep.simxSetJointTargetPosition(clientID,joint4,dbb,opmode)\n            print("2") \n        if keyboard.is_pressed("3"):\n            df=df+0.2\n            db=db+0.2\n            vrep.simxSetJointTargetPosition(clientID,joint5,df,opmode)\n            vrep.simxSetJointTargetPosition(clientID,joint3,db,opmode)\n            print("3") \n        if keyboard.is_pressed("4"):\n            dff=dff+0.2\n            dbb=dbb+0.2\n            vrep.simxSetJointTargetPosition(clientID,joint2,dff,opmode)\n            vrep.simxSetJointTargetPosition(clientID,joint4,dbb,opmode)\n            print("4")     \n            \n              \nelse:\n    print (\'Failed connecting to  remote API server\')\n    print (\'End\') \n', 'tags': '', 'url': 'W15coppelia模擬.html'}, {'title': '直播影片', 'text': '\n', 'tags': '', 'url': '直播影片.html'}, {'title': 'w12', 'text': '40823221 40823237 主題: ipv4操作api \n \n 40823220 40823250 主題:Task2、ipv4講解、作品的圖檔進度及講解和參考資料 \n \n', 'tags': '', 'url': 'w12.html'}, {'title': 'w13', 'text': '上課直播 \n 40823205 40823228 \n 主題:解決CMSIMDE版本錯誤 \n \n \n 40823220 40823250 \n 主題:介紹inventor及 reveal教學 \n \n', 'tags': '', 'url': 'w13.html'}, {'title': 'w14', 'text': '線上同步教學 \n 第一次直播 \n \n 第二次直播 \n \n', 'tags': '', 'url': 'w14.html'}, {'title': 'w15', 'text': '上課直播影片 \n \n 於直播中討論出繪製新的攀爬地圖，使攀爬機能發揮攀爬技能 \n 1.新增越野車載點: 越野車場景1、2 載點 。繪圖者:40823220 黃彥維 \n 2.開始模擬新場景，並串聯機械手臂模型，將機械手臂與我們stage3的場景做結合 \n 3.構想:利用機械手臂，搬取障礙物(場景1、2)供越野車爬行。 \n', 'tags': '', 'url': 'w15.html'}, {'title': 'Task2', 'text': '', 'tags': '', 'url': 'Task2.html'}, {'title': 'Stage 1', 'text': 'stage1-bg14 \n \n import sim as vrep\nimport math\nimport random\nimport time\nimport keyboard\n   \nprint (\'Start\')\n   \n# Close eventual old connections\nvrep.simxFinish(-1)\n# Connect to V-REP remote server\nclientID = vrep.simxStart(\'127.0.0.1\', 19997, True, True, 5000, 5)\n  \nif clientID !=-1:\n    print (\'Connected to remote API server\')\n   \n    res = vrep.simxAddStatusbarMessage(\n        clientID, "40823242",\n        vrep.simx_opmode_oneshot)\n          \n    if res not in (vrep.simx_return_ok, vrep.simx_return_novalue_flag):\n        print("Could not add a message to the status bar.")\n          \n    opmode = vrep.simx_opmode_oneshot_wait\n    vrep.simxStartSimulation(clientID, opmode)\n    ret,vertical_handle=vrep.simxGetObjectHandle(clientID,"1",opmode)#設定軸對應名稱\n \n    while True:\n        #keyboard "w" 前進\n     if keyboard.is_pressed("w"):\n            print("up")\n            \n            vrep.simxSetJointTargetVelocity(clientID,vertical_handle,-0.01,opmode)\n     if keyboard.is_pressed("s"):#keyboard "s" 後退\n            print("down")\n            \n            vrep.simxSetJointTargetVelocity(clientID,vertical_handle,0.01,opmode)\n \n     if keyboard.is_pressed("q"):#keyboard "q" 前進後退停止\n            print("stop")\n            \n            vrep.simxSetJointTargetVelocity(clientID,vertical_handle,0,opmode)\n      \nelse:\n    print (\'Failed connecting to  remote API server\')\nprint (\'End\') \n \n stage1-bg16 \n \n stage1-bg24 \n \n import sim as vrep\nimport math\nimport random\nimport time\nimport keyboard\n  \nprint (\'Start\')\n  \n# Close eventual old connections\nvrep.simxFinish(-1)\n# Connect to V-REP remote server\nclientID = vrep.simxStart(\'192.168.50.217\', 19997, True, True, 5000, 5)\n   \nif clientID !=-1:\n    print (\'Connected to remote API server\')\n    \n    res = vrep.simxAddStatusbarMessage(\n        clientID, "40823204",\n        vrep.simx_opmode_oneshot)\n           \n    if res not in (vrep.simx_return_ok, vrep.simx_return_novalue_flag):\n        print("Could not add a message to the status bar.")\n           \n    opmode = vrep.simx_opmode_oneshot_wait\n    STREAMING = vrep.simx_opmode_streaming\n      \n    vrep.simxStartSimulation(clientID, opmode)\n     \n     \n    ret,joint0=vrep.simxGetObjectHandle(clientID,"joint0",opmode)\n    ret,joint1=vrep.simxGetObjectHandle(clientID,"joint1",opmode)\n    dy=0\n    dr=0\n    vrep.simxSetJointTargetPosition(clientID,joint0,dy,opmode)\n    vrep.simxSetJointTargetPosition(clientID,joint1,dr,opmode)\n     \n    while True:\n        #Clockwise\n        if keyboard.is_pressed("2"):\n            dy=dy-0.1\n            dr=dr+0.1\n            vrep.simxSetJointTargetPosition(clientID,joint0,dy,opmode)\n            vrep.simxSetJointTargetPosition(clientID,joint1,dr,opmode)\n            print("go")\n  \nelse:\n    print (\'Failed connecting to  remote API server\')\n    print (\'End\') \n \n \n', 'tags': '', 'url': 'Stage 1.html'}, {'title': 'Stage 2', 'text': 'stage2-bg12 \n \n \n stage2-bg14 \n \n import sim as vrep\nimport math\nimport random\nimport time\nimport keyboard\n  \nprint (\'Start\')\n  \n# Close eventual old connections\nvrep.simxFinish(-1)\n# Connect to V-REP remote server\nclientID = vrep.simxStart(\'192.168.50.217\', 19997, True, True, 5000, 5)\n   \nif clientID !=-1:\n    print (\'Connected to remote API server\')\n    \n    res = vrep.simxAddStatusbarMessage(\n        clientID, "40823204",\n        vrep.simx_opmode_oneshot)\n           \n    if res not in (vrep.simx_return_ok, vrep.simx_return_novalue_flag):\n        print("Could not add a message to the status bar.")\n           \n    opmode = vrep.simx_opmode_oneshot_wait\n    STREAMING = vrep.simx_opmode_streaming\n      \n    vrep.simxStartSimulation(clientID, opmode)\n     \n     \n    ret,fwheel_handle=vrep.simxGetObjectHandle(clientID,"joint0",opmode)\n    ret,bwheel_handle=vrep.simxGetObjectHandle(clientID,"joint2",opmode)\n    ret,pole1_handle=vrep.simxGetObjectHandle(clientID,"joint3",opmode)\n    ret,pole2_handle=vrep.simxGetObjectHandle(clientID,"joint4",opmode)\n    ds=0\n    dy=0\n    df=0\n    db=0\n    vrep.simxSetJointTargetPosition(clientID,fwheel_handle,df,opmode)\n    vrep.simxSetJointTargetPosition(clientID,bwheel_handle,db,opmode)\n    vrep.simxSetJointTargetPosition(clientID,pole1_handle,ds,opmode)\n    vrep.simxSetJointTargetPosition(clientID,pole2_handle,dy,opmode)\n     \n     \n    while True:\n        #Clockwise\n        if keyboard.is_pressed("2"):\n            ds=ds-0.01\n            dy=dy-0.01\n            vrep.simxSetJointTargetPosition(clientID,pole1_handle,ds,opmode)\n            vrep.simxSetJointTargetPosition(clientID,pole2_handle,dy,opmode)\n            print("up")\n        if keyboard.is_pressed("4"):\n            ds=ds+0.01\n            dy=dy+0.01\n            vrep.simxSetJointTargetPosition(clientID,pole1_handle,ds,opmode)\n            vrep.simxSetJointTargetPosition(clientID,pole2_handle,dy,opmode)\n            print("down")\n        if keyboard.is_pressed("6"):\n            df=df+0.2\n            db=db+0.2\n            vrep.simxSetJointTargetPosition(clientID,fwheel_handle,df,opmode)\n            vrep.simxSetJointTargetPosition(clientID,bwheel_handle,db,opmode)\n            print("left")\n        if keyboard.is_pressed("8"):\n            df=df-0.2\n            db=db-0.2\n            vrep.simxSetJointTargetPosition(clientID,fwheel_handle,df,opmode)\n            vrep.simxSetJointTargetPosition(clientID,bwheel_handle,db,opmode)\n            print("right")\n \n \n              \nelse:\n    print (\'Failed connecting to  remote API server\')\n    print (\'End\') \n \n', 'tags': '', 'url': 'Stage 2.html'}, {'title': 'Stage 3', 'text': '', 'tags': '', 'url': 'Stage 3.html'}, {'title': '期末報告 PDF', 'text': '檔案下載 \n \n', 'tags': '', 'url': '期末報告 PDF.html'}, {'title': '小組個人心得', 'text': '', 'tags': '', 'url': '小組個人心得.html'}, {'title': '40823204 賴惟嘉', 'text': '這學期學到了很多工具，包含 coppelia 場景的建立以及許多程式的寫法，原本以為自 己完蛋了，因為高中只學過如何畫圖卻沒接觸過程式和 coppelia 這套工具，但是有努力終有成果，經過這幾週 的洗禮，我也熟悉了這些操作，然後在程式的部分我還 有不足處，還需要去學習，同時也很感謝40823214 教了 我許多。 \n', 'tags': '', 'url': '40823204 賴惟嘉.html'}, {'title': '40823205 李詩涵', 'text': '後期因為github 被鎖讓我摸索了很 久，還是沒辦法解封，還好之後有fossil 能夠讓我再呈 現我的網站出來，只是比較麻煩一點點而已，在這學期 真的學到了很多東西，主要是CoppeliaSim，一開始看到 是全英文讓我感到很害怕，但後來慢慢摸索就有懂一些 了，英文真的很重要。在w16 的考試多虧有同學的幫助 也學到了很多，雖然我的程式一直模擬不出來，但我還 是反覆的做跟思考如何解決，並求助同學的幫忙，也謝 謝組員們的幫助。 \n', 'tags': '', 'url': '40823205 李詩涵.html'}, {'title': '40823220 黃彥維', 'text': '經過這學期的洗禮，我學會了是 CoppeliaSim 以及Onshape 這兩套軟體，還有Lua 跟Py thon 程式的基本認知，還有更多的附加知識，例如 Youtobe 的剪片上字幕，產品商業化會遇到的問題等 等，但最重要的就是團隊合作，讓我們整體的工作，對 每個人的負擔都減輕很多，我在這個團體裡負責的工 作，主要就是處理圖檔的部分，依照組員討論出來，產 品的外觀，去把它繪製出來，並且不斷地更新，我很榮 幸，能為團隊帶來貢獻，這真的是很有成就感的事。 \n', 'tags': '', 'url': '40823220 黃彥維.html'}, {'title': '40823221 陳柏翰', 'text': '這學期分成了三個階段，在每一個 階段都有學到東西，最後在w16 exam 裡面也算是對個人 能力做個小測試，所以這學期能學到的絕對不只是程式 語言或是CoppeliaSim 模擬這幾樣東西而已，反而可以學 到該如何分工或是與團隊溝通等等的。最後想學程式的 話英文真的滿重要的。 \n', 'tags': '', 'url': '40823221 陳柏翰.html'}, {'title': '40823228 丁偉倫', 'text': '經過本學期的課程之後，讓我學到了非 常多東西，從一開始的兩人小組在協同時，只需要跟一個 組員溝通，到四人小組之後，在小組溝通及資料整理上， 漸漸浮現的問題，到最後的八人小組任務時，不管是工作 分配、資料整合上，難度都增加許多，但是如果小組內多 溝通、多採納彼此不同的意見，在協同任務中，一定可以 創造更好的自我價值，也會使自己的力量為團隊帶來極大 的幫助，所以在協同任務中使我了解到團隊合作及工作分 配的重要性。 \n', 'tags': '', 'url': '40823228 丁偉倫.html'}, {'title': '40823237 吳青諭', 'text': '這學期的課程讓我知道學習寫程式的邏 輯還有模擬很重要，因為可以方便做很多的事情，但英文 更重要，看不懂英文要怎麼學程式語言呢，要釣魚也要先 學會用釣竿。再來就是團隊合作的部分，主動、肯吃苦的 人可能會辛苦一點，但收穫肯定也會跟辛苦、努力的程度 成正比，那些消極的人沒收穫是他們的損失，抄來的終究 是別人的。最後，謝謝老師的耐心指導，很多時候問老師 問題，老師都不僅僅處理問題而已，還會花時間跟我們講 解問題的根本及分享在程式裡的一些知識。 \n', 'tags': '', 'url': '40823237 吳青諭.html'}, {'title': '40823242 游子建', 'text': '這一學期我學到非常多東西，從一開 始兩人小組我連COPPELIASIM 都不知如何使用，接著 四人小組慢慢熟悉COPPELIASIM，到了九人小組也學到 更多的東西，組員之間知識技能上的協助與教導，我也 學會了如何使用LUA 和API 控制，而我認為我自己也 有很多不足的地方，像是英文不好、程式語言懂得不夠 多等，這些都是我需要加強的地方，感謝這學期的組員 及老師的教導。 \n', 'tags': '', 'url': '40823242 游子建.html'}, {'title': '40823250 張哲瑀', 'text': '透過這學期的課程，在學習程式與 軟體應用中必須花費相當多的心力及思考，其中團隊的 幫助下，每個人分工合作達到盡自己所能在讓團隊進 步，我也知道說在這當中我受別人的幫助算是較多的那 位，但也沒有因為較弱而放棄對程式的了解，那麼8 人 的任務確實跟2 人與4 人沒法比，至少在過程中都是盡 可能試著去明白其中道理，˙也謝謝各位在這期間的幫 助及努力，為這小團隊做了很多，謝謝各位的指教！ \n', 'tags': '', 'url': '40823250 張哲瑀.html'}, {'title': '40832244 林晉廷', 'text': '這學期學到了不少的新知識，但除 了前兩次的分組能幫助隊伍，最後的分組就沒有我能幫 助的，只能跟在大家後面學習!在W16 我學到了不少東 西，但我的進度還是落後的。我的程度相對同學落後， 看起來對團隊沒貢獻，但我會照著別人的操作跟著做， 總比怠惰的人的上進。較可惜的是我github 被鎖，經過 我無數次的發送意見反饋還是沒解封，很擔心我的成績 沒救了。最後謝謝老師以及不幸跟我同組的同學，加重 你們的工作量有很抱歉，也謝謝一路上幫助我課業的同 學們，謝謝大家。 \n', 'tags': '', 'url': '40832244 林晉廷.html'}, {'title': '筆記', 'text': '', 'tags': '', 'url': '筆記.html'}, {'title': 'coppelia啟動教學', 'text': '如何開啟stl檔及基本教學 \n 1.打開coppeliasim \n 2.點選File>Import>Mesh>選擇要打開的檔案 \n \n 3.出現import options可自行選擇y或z軸>點選import即可叫出檔案 \n \n 4.開啟後場景 \n \n', 'tags': '', 'url': 'coppelia啟動教學.html'}, {'title': 'lua語法和按鍵介紹', 'text': "1.XXX=sim.getObjectHandle('joint') \n 說明:XXX是可以自己定義的名詞，此指令定義XXX為一個連接軸，('joint')為該軸在場景裡面的名稱 \n 2.sim.setJointTargetPosition(XXX,90) \n 說明: XXX移動至90這個位置，或旋轉至90rad \n 若此為一自轉軸要將程式寫為sim.setJointTargetPosition(XXX,0 * math.pi / 180 ) \n 3.常用LUA按鍵控制代碼介紹 \n \n \n \n 按鍵 \n 使用代碼 \n 按鍵 \n 使用代碼 \n \n \n 按鍵上 \n 2007 \n 1 \n 49 \n \n \n 按鍵下 \n 2008 \n 2 \n 50 \n \n \n 按鍵左 \n 2009 \n 3 \n 51 \n \n \n 按鍵右 \n 2010 \n 4 \n 52 \n \n \n 空白鍵 \n 32 \n \n \n \n \n \n \n", 'tags': '', 'url': 'lua語法和按鍵介紹.html'}]};